var img = "data:image/png;base64,"
var tipoLetra = "data:application/octet-stream;base64,"

function generarPDF(event) {
    event.preventDefault();

    const tbody = document.querySelector("tbody");
    if (tbody.childElementCount === 0) {
    alert("No se puede :D");
    return;
    }

    const rows = recorrerTabla();
    const doc = new jsPDF();
    doc.addFont(tipoLetra, "Times New Roman", "bold");
    doc.addImage(img, 0, 2, 210, 80);

    const columnWidths = [21, 47, 47, 27, 38];
    
    const table = doc.autoTable({
        startY: 76,
        head: [rows[0]], 
        body: rows.slice(1), 
        theme: "grid", 
        headStyles: {
            fillColor: [154, 88, 51], 
            textColor: [255, 255, 255],
            fontStyle: "bold",
            fontSize: 12
        },
        styles: {
            font: "Times New Roman", 
            fontStyle: "normal",
            fontSize: 10,
            halign: "center",
            lineColor: [154, 88, 51], // Color de lnea de la tabla (azul)
            lineWidth: 0.4, // Ancho de lnea de la tabla
        },
        columnStyles: {
            0: { columnWidth: columnWidths[0] },
            1: { columnWidth: columnWidths[1] },
            2: { columnWidth: columnWidths[2] },
            3: { columnWidth: columnWidths[3] },
            4: { columnWidth: columnWidths[4] }
        }
    });

    
    const currentDate = new Date();
    const year = currentDate.getFullYear();
    const month = String(currentDate.getMonth() + 1).padStart(2, '0');
    const day = String(currentDate.getDate()).padStart(2, '0');

    // Nombre del archivo
    const nombreArchivo = "lista-responsables";

    // Agregar la extensin de fecha al nombre del archivo
    const nombreArchivoConFecha = `${nombreArchivo}_${year}-${month}-${day}.pdf`;

    // Guardar el archivo con el nuevo nombre
    doc.save(nombreArchivoConFecha);

    }  

function recorrerTabla() {
    const rows = [];

    const table = document.getElementById("tabla_responsable");

    for (let i = 0; i < table.rows.length; i++) {
    const row = [];
        for (let j = 0; j < Math.min(5, table.rows[i].cells.length); j++) {
            let col = table.rows[i].cells[j].innerText;
                row.push(col);
        }
    rows.push(row);
    }

    return rows;
}
